import { InputBase } from '@mui/material';
import './search.css';

const Search = () => {
    return (
        <>
            <div className="inputContainer">
                <InputBase placeholder="hello" className="inputdata" />
                <div></div>
            </div>
        </>
    );
};

export default Search;
